import styled from "styled-components";

export const Card = styled.div`
  display: flex;
`;

export const ThumbNail = styled.div`
  img {
    width: 100px;
    height: 100px;
  }
`;
export const Detail = styled.div`
  border-radius: 4px;
  ul {
    overflow-wrap: break-word;
  }
`;
